import React from 'react';
import styles from './ModalUpdate.module.css';

const ModaUpdate = () => {
  return (
    <div className={styles.containerBackGround}>
      <div className={styles.container}>
        <div className={styles.containerAux}></div>
        <div>
          <Input
            type="text"
            placeholder="Filme"
            onChange={({ target }) => setNome(target.value)}
          />
          <Input
            type="text"
            placeholder="Genero"
            onChange={({ target }) => setGenero(target.value)}
          />
          <Input
            type="text"
            placeholder="Foto"
            onChange={({ target }) => setFoto(target.value)}
          />
          <Input
            type="text"
            placeholder="Duração"
            onChange={({ target }) => setDuracao(target.value)}
          />

          <Button
            text="Finish"
            onClick={() => addFilm(nome, genero, foto, duracao)}
          />
        </div>
      </div>
    </div>
  );
};

export default ModaUpdate;
